        "description": "Chernobyl is an HBO mini-series that reintroduced the world to the nuclear catastrophe that occurred on April 26th, 1986 at the Chernobyl nuclear reactor in the Soviet Union, in what is now Ukraine. The series followed the tragedy that befell the region after the accident and the efforts made by some heroic people to prevent further damage. \n\nIn this video, we will discuss the scientific accuracy of some key aspects of this widely popular show. We also discuss how the RBMK reactor works and is it really possible for an RBMK reactor to explode?\n\nLink to how RMBK reactors work: http://large.stanford.edu/courses/2016/ph241/stephanus2/docs/lederman.pdf\n\n#chernobyl #hbo #science\n\nReferences\nhttps://pubmed.ncbi.nlm.nih.gov/1822956/\nhttps://www.tandfonline.com/doi/full/10.1080/01635581.2017.1250922\nhttp://large.stanford.edu/courses/2014/ph241/alaeian2/\nhttps://www.cdc.gov/nceh/radiation/emergencies/ki.htm\nhttps://artsci.wustl.edu/ampersand/cost-lies-technical-analysis-hbos-chernobyl \nhttps://www.ucsf.edu/news/2019/07/414976/real-chernobyl-qa-radiation-exposure-expert\nhttps://inis.iaea.org/search/search.aspx?orig_q=RN:52070943\nhttps://www.cdc.gov/nceh/radiation/emergencies/arsphysicianfactsheet.htm\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
